INSERT INTO `email_templates` (`id`, `title`, `subject`, `content`, `view_order`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'New Stock Creation', 'Notification New Stock for {{stock_id}}', '<p><span>Hi Operations,</span></p>\r\n<p><span>New Stock {{stock_id}} is now available </span></p>\r\n<p><span>Please Click of the URL Link: {{url}} to acknowledge</span></p>\r\n<p><span>Thank you,</span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 03:18:59', '2020-10-02 03:18:59'),
(2, 'Notification New work request', '{{stock_id}} Notification New work request', '<p><span>Hi Operations,</span></p>\r\n<p><span>New Work {{stock_id}} is now available </span></p>\r\n<p><span>Please click on the URL Link: {{url}} to acknowledge.<br /><br /></span></p>\r\n<p><span>Thank you,</span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(3, 'Notification New Sales Ready', 'Notification New Sales Ready {{stock_id}}', 'Hi Sales,<br /><br />New Work {{stock_id}} is now available <br />Please Click on the URL Link: {{url}} to acknowledge.<br /><br />Thank you<br />1 Auto', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(4, 'PI ready to view', 'PI is ready to view {{stock_id}} {{make}} {{model}}', '<p><span>Dear {{username}},</span></p>\r\n<p><span>Proforma Invoice for {{stock_id}}<stock ref=\"\" number=\"\">&nbsp;is ready to view. You can check from Transaction History Page <link /></stock></span></p>\r\n<p><span>PI : {{pi_number}}</span></p>\r\n<p><span>Chassis: {{chassis_no}}</span></p>\r\n<p>{{stock_id}} {{make}} {{model}}</p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Thank you</span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-03 06:43:12'),
(5, 'Prepare for EPZ Reminder', 'Reminder', 'Please prepare for EPZ {{countdays}} days left {{vehicle_number}}', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(6, 'Prepare for EPZ', 'Prepare for EPZ', '<p>Please prepare for EPZ {{stock_id}} {{vehicle_number}}</p>\r\n<p>Thank you</p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(7, 'Car Ready for EPZ', 'Car Ready for EPZ', 'Ready for EPZ {{stock_id}} {{vehicle_number}} {{makemodel}} is ready for EPZ', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(8, 'Car Ready for EPZ (Towing)', 'Car Ready for EPZ', 'Car Ready for EPZ. Please arrange towing to EPZ {{stock_id}} {{vehicle_number}} {{makemodel}}', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(9, 'Disposal Reminder', 'Disposal Reminder', '<p><span>Hi, </span></p>\r\n<p><span>Disposal Reminder {{stock_id}} {{vehicle_number}}</span></p>\r\n<p><span>Please dispose by {{disposal_date}}</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Thank you </span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-10-02 04:35:11'),
(10, 'Stock Unavailable', '{{stock_id}} {{makemodel}}: Stock Unavailable', '<p><span>Dear Sir/Madam, </span></p>\r\n<p><span>{{stock_id}}</span></p>\r\n<p><span>{{makemodel}} is unavailable. {{pi_number}} has been automatically cancelled.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Thank you</span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-08 14:33:07'),
(11, 'PI Cancelled to Admin/Vendor', 'PI Expired {{stock_id}} {{makemodel}}', '<p><span>Dear Admin/Vendor,</span></p>\r\n<p><span>Proforma Invoice for {{stock_id}} has expired. We will try and resell the vehicle.</span></p>\r\n<p><span>PI: {{pi_number}}</span></p>\r\n<p><span>Chassis: {{chassis_no}}</span></p>\r\n<p>{{stock_id}} {{makemodel}}</p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Thank you for your support</span></p>\r\n1 Auto', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-08 14:39:50'),
(12, 'PI Cancelled to Buyer', 'PI Expired {{stock_id}} {{makemodel}}', '<p><span>Dear {{username}},</span></p>\r\n<p><span>Proforma Invoice for {{stock_id}} has expired. We have not received your TT copy. Kindly contact our sales staff for extension if necessary. {{url}}</span></p>\r\n<p><span>PI: {{pi_number}}</span></p>\r\n<p><span>Chassis: {{chassis_no}}</span></p>\r\n<p>{{stock_id}} {{makemodel}}</p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>We look forward to serve you in the near future.</span></p>\r\n<p><span>1 Auto</span></p>', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-08 14:41:48'),
(13, 'Payment Confirmation To Sales/Vendor', 'Payment Confirmation Booking Start {{stock_id}}', '{{makemodel}}', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-08 17:31:52'),
(14, 'Payment Confirmation To Buyer', 'Payment Confirmed Booking Start {{stock_id}}', 'Please arrange outgoing inspection for the mentioned vehicle {{url}}', 0, 1, NULL, '2020-10-02 04:35:11', '2020-12-08 17:33:37'),
