(27, 'User Verification - To Customer', 'User Verification - 1auto2', '<table class=\"email-body_inner\" role=\"presentation\" width=\"570\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\"><!-- Body content -->\r\n<tbody>\r\n<tr>\r\n<td class=\"content-cell\">\r\n<div class=\"f-fallback\">\r\n<h1>Hello,</h1>\r\n<p>Thank you for joining 1auto2<br /><br />Please click the link below to activate your account.</p>\r\n{{url}}\r\n<p>Thanks, <br />1auto2 Team</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 1, NULL, '2020-10-24 05:01:09', '2020-10-24 05:01:47'),
(29, 'User Notification - Car Availability', 'User Notification - 1auto2', '<table class=\"email-body_inner\" role=\"presentation\" width=\"570\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\"><!-- Body content -->\r\n<tbody>\r\n<tr>\r\n<td class=\"content-cell\">\r\n<div class=\"f-fallback\">\r\n<h1>Hello {{name}},</h1>\r\n<p>The following car is available now.<br /><br />Please click <a href=\"/{{action_url}}\">here</a> to see the details.</p>\r\n<p>Thanks, <br />1auto2 Team</p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 1, NULL, '2020-11-18 10:01:00', '2020-11-18 10:34:46'),
(28, 'Forgot Password - User/Admin', 'Reset Password Notification', '<table class=\"email-body_inner\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\"><!-- Body content -->\r\n<tbody>\r\n<tr>\r\n<td class=\"content-cell\">\r\n<div class=\"f-fallback\">\r\n<h1>Dear User,</h1>\r\n<p>You are receiving this email because we received a password reset request for your account.</p>\r\n<!-- Action -->\r\n<table class=\"body-action\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\"><!-- Border based button\r\n               https://litmus.com/blog/a-guide-to-bulletproof-buttons-in-email-design -->\r\n<table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\"><a href=\"/{{action_url}}\" class=\"f-fallback button button--green\" target=\"_blank\" rel=\"noopener\">Reset Password</a></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>If you did not request a password reset, no further action is required.</p>\r\n<p>Regards, <br />The AutoQuote Team</p>\r\n<!-- Sub copy -->\r\n<table class=\"body-sub\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p class=\"f-fallback sub\">If you&rsquo;re having trouble with the button above, copy and paste the URL below into your web browser.</p>\r\n<p class=\"f-fallback sub\">{{action_url}}</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 0, 1, NULL, '2020-11-18 10:07:24', '2020-11-18 10:07:24'),
(30, 'Contact Enquiry (Thank you) - To Customer', 'Thank you for Enquiry!', 'Dear Customer, <br /><br /><em>Thank you for your enquiry. Our team will contact you as soon as possible.</em>', 0, 1, NULL, '2020-12-06 16:00:00', '2020-12-06 23:40:49'),
(31, 'Contact Enquiry (User Detail) - To Admin', 'Contact Enquiry', '<table class=\"email-body_inner\" align=\"center\" width=\"570\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\"><!-- Body content -->\r\n<tbody>\r\n<tr>\r\n<td class=\"content-cell\">\r\n<div class=\"f-fallback\">\r\n<h1>Hi Admin,</h1>\r\n<p>We have received on contact enquiry. Please find the detail below,</p>\r\n<table class=\"attributes\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<td class=\"attributes_content\">\r\n<table width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\" style=\"height: 108px; width: 100%;\">\r\n<tbody>\r\n<tr style=\"height: 18px;\">\r\n<td class=\"attributes_item\" style=\"height: 18px;\"><span class=\"f-fallback\"> <strong>Name:</strong> {{full_name}} </span></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td class=\"attributes_item\" style=\"height: 18px;\"><span class=\"f-fallback\"> <strong>Email:</strong> {{email}} </span></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"height: 18px;\"><span class=\"f-fallback\"></span> <strong>Contact Number:</strong> {{contact_number}}</td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"height: 18px;\"><span class=\"f-fallback\"> <strong>Company:</strong> {{company}}</span></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"height: 18px;\"><span class=\"f-fallback\"> <strong>Enquiry/Purpose:</strong> {{purpose}}</span></td>\r\n</tr>\r\n<tr style=\"height: 18px;\">\r\n<td style=\"height: 18px;\"><span class=\"f-fallback\"> <strong>Comments/Feedback:</strong> {{comments}}</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- Action -->\r\n<table class=\"body-action\" align=\"center\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\" role=\"presentation\">\r\n<tbody>\r\n<tr>\r\n<td align=\"center\"><!-- Border based button\r\n               https://litmus.com/blog/a-guide-to-bu