(1, 'Home', 'Home', 'home', 2, NULL, '{\"newest_car_section_heading\":\"Featured Newest Cars\",\"newest_car_section_link_label\":\"Learn More\",\"newest_car_section_link\":\"http:\\/\\/127.0.0.1:8000\\/cars\",\"clearance_car_section_heading\":\"Featured Clearance Cars\",\"clearance_car_section_link_label\":\"VIEW ALL CLEARANCE CARS\",\"clearance_car_section_link\":\"http:\\/\\/127.0.0.1:8000\\/cars\",\"popular_car_section_heading\":\"Featured Popular Cars\",\"popular_car_section_link_label\":\"VIEW ALL POPULAR CARS\",\"popular_car_section_link\":\"http:\\/\\/127.0.0.1:8000\\/cars\",\"how_to_buy_section_heading\":\"How To Buy\",\"how_to_buy_section_content\":\"<div class=\\\"row\\\">\\r\\n<div class=\\\"col-lg col-md-4 col-6\\\">\\r\\n<div class=\\\"list-2\\\">\\r\\n<figure><img src=\\\"\\/photos\\/5\\/icon01.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h5>Step 1<\\/h5>\\r\\n<p>Sign up with us<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-lg col-md-4 col-6\\\">\\r\\n<div class=\\\"list-2\\\">\\r\\n<figure><img src=\\\"\\/photos\\/5\\/icon02.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h5>Step 2<\\/h5>\\r\\n<p>Enquire on the product<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-lg col-md-4 col-6\\\">\\r\\n<div class=\\\"list-2\\\">\\r\\n<figure><img src=\\\"\\/photos\\/5\\/icon03.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h5>Step 3<\\/h5>\\r\\n<p>Order product and make payment to us<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-lg col-md-4 col-6\\\">\\r\\n<div class=\\\"list-2\\\">\\r\\n<figure><img src=\\\"\\/photos\\/5\\/icon04.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h5>Step 4<\\/h5>\\r\\n<p>We will update the system on the shipment and date<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"col-lg col-md-4 col-6\\\">\\r\\n<div class=\\\"list-2\\\">\\r\\n<figure><img src=\\\"\\/photos\\/5\\/icon05.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h5>Step 5<\\/h5>\\r\\n<p>Our assigned clearing agents will clear the cargo for you<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\",\"testimonial_section_heading\":\"Testimonials\",\"testimonial_section_link_label\":\"SHARE YOUR STORIES WITH US\",\"testimonial_section_link\":\"http:\\/\\/127.0.0.1:8000\\/testimonials\",\"newsletter_section_content\":\"<h3 class=\\\"title-3\\\">Be the first to know all available cars?<\\/h3>\\r\\n<p>Subscribe newsletter with us.<\\/p>\"}', 0, 0, NULL, '_self', 1, NULL, NULL, NULL, 0, 1, 1, '2020-05-19 20:50:22', '2020-10-12 05:18:11'),
(2, 'About Us', NULL, 'about-us', 2, NULL, '{\"section_1_picutre\":\"storage\\/pages\\/1607222404_img07.jpg\",\"section_2_picutre\":\"storage\\/pages\\/1607222404_img08.jpg\",\"section_1_title\":\"Who we are\",\"section_1_content\":\"<p>1 Auto Co. is a global car exporter headquarter based in Singapore. We are an automotive exporter with seeking to make a difference to the current business. We are committed to achieve a systematic way of buying cars online.<\\/p>\",\"section_2_title\":\"We redefine your dreams into reality by owning your first or subsequent automobile.\",\"section_2_content_1\":\"<figure><img src=\\\"\\/images\\/img1\\/icon\\/icon06.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h4 class=\\\"title-4\\\">Our Mission<\\/h4>\\r\\n<div class=\\\"height\\\">\\r\\n<p>Simplify the process of buying with constant updates on your purchase as well as shipping updates.<\\/p>\\r\\n<\\/div>\\r\\n<ul class=\\\"ul-list1\\\">\\r\\n<li>100% delivery rate<\\/li>\\r\\n<li>100% satisfactory rate<\\/li>\\r\\n<\\/ul>\",\"section_2_content_2\":\"<figure><img src=\\\"\\/images\\/img1\\/icon\\/icon07.png\\\" alt=\\\"\\\" \\/><\\/figure>\\r\\n<h4 class=\\\"title-4\\\">Our Vision<\\/h4>\\r\\n<div class=\\\"height\\\">\\r\\n<p>Fulfilling your autocar dreams are our upmost priority<\\/p>\\r\\n<\\/div>\\r\\n<ul class=\\\"ul-list1\\\">\\r\\n<li>We work while you sleep to make sure you get your dreams in time, always in time for your special occasion.<\\/li>\\r\\n<li>Customer satisfaction guaranteed<\\/li>\\r\\n<\\/ul>\"}', 0, 0, NULL, '_self', 2, '1 Auto Co. Pte Ltd | About Us', '1 Auto Co. is a global car exporter headquarter based in Singapore. We are an automotive exporter with seeking to make a difference to the current business. We are committed to achieve a systematic way of buying cars online.', '1 Auto Co, Cars', 1, 0, 1, '2020-05-17 22:19:43', '2020-12-07 13:14:59'),
