(12, 'Arvind', 'storage/testimonial/1607314841_img05.jpg', 'One morning, when Gregor Samsa woke from troubled dreams, he found himself transformed in his bed into a horrible vermin. He lay on his armour-like back, and if he lifted his head a little he could see his brown belly, slightly domed and divided by arches into stiff sections. The', 2, 2, 0, 1, '2020-08-19 03:03:24', '2020-12-07 01:50:41'),
(13, 'Michelle', 'storage/testimonial/1607314866_img08.jpg', 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui', 3, 2, 0, 1, '2020-08-19 03:03:50', '2020-12-07 01:51:06'),
(14, 'Stark', 'storage/testimonial/1607314877_img06.jpg', 'Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis, sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate', 5, 1, 6, 3, '2020-08-19 03:04:06', '2020-12-07 01:51:17'),
(15, 'Glenn', 'storage/testimonial/1607314882_img05.jpg', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects,', 5, 1, 0, 1, '2020-08-19 03:04:25', '2020-12-07 01:51:22'),
(16, 'Jhonson', 'storage/testimonial/1607314891_img04.jpg', 'Li Europan lingues es membres del sam familie. Lor separat existentie es un myth. Por scientie, musica, sport etc, litot Europa usa li sam vocabular. Li lingues differe solmen in li grammatica, li pronunciation e li plu commun vocabules. Omnicos directe al desirabilite de un nov lingua franca: On refusa', 6, 1, 0, 1, '2020-08-19 03:04:41', '2020-12-07 01:51:31'),
(17, 'Shi Min', 'storage/testimonial/1607314899_img05.jpg', 'The European languages are members of the same family. Their separate existence is a myth. For science, music, sport, etc, Europe uses the same vocabulary. The languages only differ in their grammar, their pronunciation and their most common words. Everyone realizes why a new common language would be desirable: one', 7, 2, 0, 1, '2020-08-19 03:05:02', '2020-12-07 01:51:39'),
