(19, 'Jafir', 'storage/testimonial/1607314810_img04.jpg', 'A wonderful serenity has taken possession of my entire soul, like these sweet mornings of spring which I enjoy with my whole heart. I am alone, and feel the charm of existence in this spot, which was created for the bliss of souls like mine. I am so happy, my', 1, 1, 2, 3, '2020-10-15 04:02:38', '2020-12-07 01:50:11'),
